-- ========================================================================================================================================================
--                                                                  Builds Tables
-- ========================================================================================================================================================

DROP TABLE IF EXISTS warehouses CASCADE;
DROP TABLE IF EXISTS dist_sts CASCADE;
DROP TABLE IF EXISTS link_wares_dists CASCADE;
DROP TABLE IF EXISTS customers CASCADE;
DROP TABLE IF EXISTS link_dists_custs CASCADE;
DROP TABLE IF EXISTS orders CASCADE;
DROP TABLE IF EXISTS link_custs_orders CASCADE;
DROP TABLE IF EXISTS items CASCADE;
DROP TABLE IF EXISTS warehouse_stock CASCADE;
DROP TABLE IF EXISTS line_items CASCADE;

CREATE TABLE warehouses (
    ware_key SERIAL,
    ware_id INTEGER,
    ware_name VARCHAR,
    street_addr VARCHAR,
    city VARCHAR,
    state_abbr VARCHAR,
    zip VARCHAR,
    sales_total NUMERIC( 10, 2 ) DEFAULT 0.0,
    sales_tax NUMERIC( 3, 2 ) DEFAULT 0.0,

    PRIMARY KEY( ware_key )
);

CREATE TABLE dist_sts (
    dist_station_key SERIAL,
    dist_station_id INTEGER,
    dist_station_name VARCHAR,
    street_addr VARCHAR,
    city VARCHAR,
    state_abbr VARCHAR,
    zip VARCHAR,
    sales_total NUMERIC( 10, 2 ) DEFAULT 0.0,
    sales_tax NUMERIC( 3, 2 ) DEFAULT 0.0,

    PRIMARY KEY( dist_station_key )
);

CREATE TABLE link_wares_dists (
    ware_key INTEGER,
    dist_station_key INTEGER,

    PRIMARY KEY( ware_key, dist_station_key ),
    FOREIGN KEY( ware_key ) REFERENCES warehouses( ware_key ) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY( dist_station_key ) REFERENCES dist_sts( dist_station_key ) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE customers (
    customer_key SERIAL,
    customer_id INTEGER,
    first_name VARCHAR,
    mid_init VARCHAR,
    last_name VARCHAR,
    street_addr VARCHAR,
    city VARCHAR(32),
    state_abbr VARCHAR,
    zip VARCHAR,
    phone VARCHAR,
    balance NUMERIC( 10, 2 ) DEFAULT 0.0,
    payment_count INTEGER DEFAULT 0,
    payment_total NUMERIC( 10, 2 ) DEFAULT 0.0,
    delivery_total INTEGER DEFAULT 0,
    discounts NUMERIC( 10, 2 ) DEFAULT 0.0,
    start_date DATE DEFAULT CURRENT_DATE, 

    PRIMARY KEY( customer_key )
);

CREATE TABLE link_dists_custs (
    dist_station_key INTEGER,
    customer_key INTEGER,

    PRIMARY KEY( dist_station_key, customer_key ),
    FOREIGN KEY( dist_station_key ) REFERENCES dist_sts( dist_station_key ) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY( customer_key ) REFERENCES customers( customer_key ) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE orders (
    order_key SERIAL,
    order_id INTEGER,
    order_date DATE DEFAULT CURRENT_DATE,
    is_complete BOOLEAN,
    num_line_items INTEGER,

    PRIMARY KEY( order_key )
);

CREATE TABLE link_custs_orders (
    order_key INTEGER,
    customer_key INTEGER,

    PRIMARY KEY( order_key, customer_key ),
    FOREIGN KEY( order_key ) REFERENCES orders( order_key ) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY( customer_key ) REFERENCES customers( customer_key ) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE items (
    item_key SERIAL,
    item_id INTEGER,
    item_name VARCHAR,
    item_price NUMERIC( 10, 2 ) DEFAULT 0.0,

    PRIMARY KEY( item_key )
);

CREATE TABLE warehouse_stock (
    ware_key INTEGER,
    item_key INTEGER,
    item_qty INTEGER DEFAULT 0,
    items_sold INTEGER DEFAULT 0,
    item_sales NUMERIC( 10, 2 ) DEFAULT 0.0,

    PRIMARY KEY( ware_key, item_key ),
    FOREIGN KEY( ware_key ) REFERENCES warehouses( ware_key ) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY( item_key ) REFERENCES items( item_key ) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE line_items (
    line_item_key SERIAL,
    order_key INTEGER,
    item_key INTEGER,
    line_item_id INTEGER, 
    qty_sold INTEGER DEFAULT 0,
    line_sales NUMERIC( 10, 2 ) DEFAULT 0.0,
    date_delivered DATE DEFAULT CURRENT_DATE,

    PRIMARY KEY( line_item_key ),
    FOREIGN KEY( order_key ) REFERENCES orders( order_key ) ON UPDATE CASCADE ON DELETE CASCADE,
    FOREIGN KEY( item_key ) REFERENCES items( item_key ) ON UPDATE CASCADE ON DELETE CASCADE
);

-- ========================================================================================================================================================
--                                                                  Transaction Functions
-- ========================================================================================================================================================

/*
 * Function that creates a new order given a unique customer, list of items, and quantity of each item ordered.
 * 
 * Parameters:
 *    cust_key - unique customer key
 *    new_items - array of item keys
 *    item_count - quantity of each item ordered.
 */
DROP FUNCTION IF EXISTS func_new_order( cust_key INTEGER, new_items, INTEGER[], item_count INTEGER[] ) CASCADE;
CREATE OR REPLACE FUNCTION func_new_order( cust_key INTEGER, new_items INTEGER[], item_count INTEGER[] )
RETURNS VOID 
AS $$
DECLARE
	prev_order_num INTEGER;
	new_order_line_count INTEGER;
	new_order_key INTEGER;
	temp_item_price NUMERIC( 10, 2 );
	temp_line_item_key INTEGER;
	temp_line_sales NUMERIC( 10, 2 );
	new_order_sales NUMERIC( 10, 2 ):= 0;

BEGIN
	
	-- Finds the customer's most recent order_key
	SELECT orders.order_id
	INTO prev_order_num
	FROM link_custs_orders 
	JOIN orders ON link_custs_orders.order_key = orders.order_key
	WHERE link_custs_orders.customer_key = cust_key
	ORDER BY order_date DESC
	LIMIT 1;
	-- If the customer does not have a previous order, prev_order_num is set to 0
	IF NOT FOUND THEN
		prev_order_num:= 0;
	END IF;

	-- Finds the number of line items in the order
	SELECT array_length( new_items, 1 ) 
	INTO new_order_line_count;

	-- Creates the new order, finds the new order key, and links it to the customer
	new_order_key:= currval( pg_get_serial_sequence('orders', 'order_key') );

	-- Loops through the new items and creates the individual line items in the database
	FOR i IN 1..new_order_line_count LOOP

		RAISE NOTICE 'Counter: %', i;

		-- Finds the new item's price
		SELECT item_price
		INTO temp_item_price
		FROM items
		WHERE item_key = new_items[i];

		-- Finds the line item sales total
		temp_line_sales:= temp_item_price * item_count[i];

		-- Creates the new line item

		-- Increments the new orders total sales
		new_order_sales:= new_order_sales + temp_line_sales;		
 
	END LOOP;

END;
$$ LANGUAGE 'plpgsql';

/*
 * Function processes a customer payment towards their balance.
 * 
 * Parameters:
 *    cust_key - unique customer key
 *    payment_amount - dollar amount of the payment
 */
DROP FUNCTION IF EXISTS func_payment_transaction( cust_key INTEGER, payment_amount NUMERIC( 10, 2 ) ) CASCADE;
CREATE OR REPLACE FUNCTION func_payment_transaction( cust_key INTEGER, payment_amount NUMERIC( 10, 2 ) )
RETURNS VOID 
AS $$
BEGIN
	-- Creates a temporary table that stores all of the info for the new payment
	DROP TABLE IF EXISTS new_payment CASCADE;
	CREATE TEMP TABLE new_payment AS
	SELECT warehouses.ware_key, dist_sts.dist_station_key, customers.customer_key
	FROM warehouses
	JOIN link_wares_dists ON warehouses.ware_key = link_wares_dists.ware_key
	JOIN dist_sts ON link_wares_dists.dist_station_key = dist_sts.dist_station_key
	JOIN link_dists_custs ON dist_sts.dist_station_key = link_dists_custs.dist_station_key
	JOIN customers ON link_dists_custs.customer_key = customers.customer_key
	WHERE customers.customer_key = cust_key;

	-- Updates the given customer's warehouse sales total
	UPDATE warehouses	
	SET sales_total = sales_total + payment_amount
	FROM new_payment
	WHERE warehouses.ware_key = new_payment.ware_key;

	-- Updates the given customer's distribution station sales total
	UPDATE dist_sts
	SET sales_total = sales_total + payment_amount
	FROM new_payment
	WHERE dist_sts.dist_station_key = new_payment.dist_station_key;

	-- Updates the given customer's current balance, payment count, and payment total
	UPDATE customers
	SET balance = balance - payment_amount, payment_count = payment_count + 1, payment_total = payment_total + payment_amount
	FROM new_payment
	WHERE customers.customer_key = new_payment.customer_key;

	-- Drops temporary table
	DROP TABLE IF EXISTS new_payment CASCADE;

END;
$$ LANGUAGE 'plpgsql';

/*
 * Function that finds the line item details of the customer's most recent order.
 * 
 * Parameters:
 *    cust_key - unique customer key
 */
DROP FUNCTION IF EXISTS func_order_status( cust_key INTEGER ) CASCADE;
CREATE OR REPLACE FUNCTION func_order_status( cust_key INTEGER )
RETURNS TABLE( 
	"Line Item" INTEGER,
	"UPC" INTEGER,
	"Item" VARCHAR,
	"Item Qty" INTEGER,
	"Amount Due" NUMERIC( 10, 2 ),
	"Date Delivered" DATE
)
AS $$
BEGIN
	RETURN QUERY
	
	-- Finds the most recent order
	WITH most_recent AS (
	SELECT orders.order_key
	FROM link_custs_orders 
	JOIN orders ON link_custs_orders.order_key = orders.order_key
	WHERE link_custs_orders.customer_key = cust_key
	ORDER BY order_date DESC, order_key DESC
	LIMIT 1 )

	-- Selects line items from the most recent order
	SELECT line_items.line_item_id, items.item_id, items.item_name, line_items.qty_sold, line_items.line_sales, line_items.date_delivered
	FROM most_recent 
	JOIN line_items ON most_recent.order_key = line_items.order_key
	JOIN items ON line_items.item_key = items.item_key
	ORDER BY line_items.line_item_id;
END;
$$ LANGUAGE 'plpgsql';

/*
 * Function that delivers all undelivered orders at a given warehouse.
 * 
 * Parameters:
 *    warehouse_key - unique warehouse key
 */
DROP FUNCTION IF EXISTS func_delivery_transaction( warehouse_key INTEGER ) CASCADE;
CREATE OR REPLACE FUNCTION func_delivery_transaction( warehouse_key INTEGER )
RETURNS VOID 
AS $$
BEGIN

	-- Creates temporary table that finds the all line items within a warehouse that have not been delivered and updates
	-- line_items and sets all undelivered lines's delivered date to the current date
	DROP TABLE IF EXISTS undelivered_items CASCADE;
	CREATE TEMP TABLE undelivered_items AS
	SELECT 
		customers.customer_key, customers.balance AS temp_balance, customers.payment_count, customers.payment_total, customers.delivery_total,
		orders.order_key, orders.order_date, orders.is_complete,
		line_items.line_item_key, line_items.line_item_id, line_items.line_sales, line_items.date_delivered

	FROM warehouses
	JOIN link_wares_dists ON warehouses.ware_key = link_wares_dists.ware_key
	JOIN dist_sts ON link_wares_dists.dist_station_key = dist_sts.dist_station_key
	JOIN link_dists_custs ON dist_sts.dist_station_key = link_dists_custs.dist_station_key
	JOIN customers ON link_dists_custs.customer_key = customers.customer_key
	JOIN link_custs_orders ON customers.customer_key = link_custs_orders.customer_key
	JOIN orders ON link_custs_orders.order_key = orders.order_key
	JOIN line_items ON orders.order_key = line_items.order_key
	WHERE warehouses.ware_key = warehouse_key AND line_items.date_delivered ISNULL
	ORDER BY orders.order_key ASC;

	UPDATE line_items
	SET date_delivered = CURRENT_DATE
	FROM undelivered_items
	WHERE line_items.line_item_key = undelivered_items.line_item_key;

	-- Updates a customer's balance with all of the items that were delivered
	DROP TABLE IF EXISTS new_balance CASCADE;
	CREATE TEMP TABLE new_balance AS
	SELECT customer_key, SUM( line_sales ) AS delivery_total
	FROM undelivered_items
	GROUP BY customer_key;

	UPDATE customers
	SET balance = balance + new_balance.delivery_total
	FROM new_balance
	WHERE customers.customer_key = new_balance.customer_key;

	-- Updates a customer's delivery count, counting a single orders as a delivery
	DROP TABLE IF EXISTS new_delivery_count CASCADE;
	CREATE TEMP TABLE new_delivery_count AS
	WITH order_count AS (
		SELECT DISTINCT customer_key, order_key
		FROM undelivered_items )
	SELECT customer_key, COUNT( order_key ) AS new_count
	FROM order_count
	GROUP BY customer_key;

	UPDATE customers
	SET delivery_total = delivery_total + new_delivery_count.new_count
	FROM new_delivery_count
	WHERE customers.customer_key = new_delivery_count.customer_key;

	-- Drops temporary tables
	DROP TABLE IF EXISTS undelivered_items CASCADE;
	DROP TABLE IF EXISTS new_balance CASCADE;
	DROP TABLE IF EXISTS new_delivery_count CASCADE;

END;
$$ LANGUAGE 'plpgsql';

/*
 * Function that given a stock threshold, counts the items from the previous 20 orders at a given
 * distribution center that are currently under the threshold.
 * 
 * Parameters:
 *    dist_station - unique distribution station key
 *    threshold - stock threshold
 */
DROP FUNCTION IF EXISTS func_stock_level_transaction( dist_station INTEGER, threshold INTEGER ) CASCADE;
CREATE OR REPLACE FUNCTION func_stock_level_transaction( dist_station INTEGER, threshold INTEGER )
RETURNS TABLE( 
	"Items Under Stock" BIGINT
)
AS $$
BEGIN
	RETURN QUERY
	
	WITH stock_query AS (
		WITH most_recent_orders AS( 
			SELECT orders.order_key, orders.order_date
			FROM dist_sts
			JOIN link_dists_custs ON dist_sts.dist_station_key = link_dists_custs.dist_station_key
			JOIN customers ON link_dists_custs.customer_key = customers.customer_key
			JOIN link_custs_orders ON customers.customer_key = link_custs_orders.customer_key
			JOIN orders ON link_custs_orders.order_key = orders.order_key
			WHERE dist_sts.dist_station_key = dist_station
			ORDER BY orders.order_date DESC, orders.order_key
			LIMIT 20 )
		SELECT DISTINCT line_items.item_key, items.item_name, warehouse_stock.item_qty
		FROM most_recent_orders
		JOIN line_items ON most_recent_orders.order_key = line_items.order_key
		JOIN items ON line_items.item_key = items.item_key
		JOIN warehouse_stock ON items.item_key = warehouse_stock.item_key
		WHERE warehouse_stock.item_qty < threshold
		ORDER BY item_key )
	SELECT COUNT(stock_query.item_key) AS "Items Under Stock"
	FROM stock_query;	

END;
$$ LANGUAGE 'plpgsql';

